webpackJsonp([0x6f8f4906262d],{818:function(n,a){n.exports={data:{post:{id:"/home/travis/build/benmvp/benmvp.github.io/content/posts/2015-09-02--learning-es6-destructuring/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/pass-baton-d303c904829efa076ed9f6844d8b9d75-f16ff.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.333333333333336%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Passing the baton"\n        title=""\n        src="/static/pass-baton-d303c904829efa076ed9f6844d8b9d75-78f2b.jpg"\n        srcset="/static/pass-baton-d303c904829efa076ed9f6844d8b9d75-dce19.jpg 200w,\n/static/pass-baton-d303c904829efa076ed9f6844d8b9d75-c1413.jpg 400w,\n/static/pass-baton-d303c904829efa076ed9f6844d8b9d75-78f2b.jpg 800w,\n/static/pass-baton-d303c904829efa076ed9f6844d8b9d75-ab4c4.jpg 1200w,\n/static/pass-baton-d303c904829efa076ed9f6844d8b9d75-f16ff.jpg 1500w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>After learning all about <a href="/learning-es6-arrow-functions/">arrow functions</a> and <a href="/learning-es6-block-level-scoping-let-const/">block-level scoping</a>, let’s continue the syntactic sugar train in our <a href="/learning-es6-series/"><em>Learning ES6</em> series</a> with <em>destructuring</em> in ECMAScript 6.</p>\n<h2 id="tldr"><a href="#tldr" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>TL;DR</h2>\n<p>Destructuring makes it easier to work with objects and arrays in JavaScript. Using a pattern syntax similar to object and array literals, we can poke into data structures and pick out the information we want into variables. This is best explained with examples:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token comment">// object pattern matching</span>\n<span class="token keyword">let</span> <span class="token punctuation">{</span>lName<span class="token punctuation">,</span> fName<span class="token punctuation">}</span> <span class="token operator">=</span> <span class="token punctuation">{</span>fName<span class="token punctuation">:</span> <span class="token string">\'John\'</span><span class="token punctuation">,</span> age<span class="token punctuation">:</span> <span class="token number">15</span><span class="token punctuation">,</span> lName<span class="token punctuation">:</span> <span class="token string">\'Doe\'</span><span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n<span class="token comment">// array pattern matching</span>\n<span class="token keyword">let</span> <span class="token punctuation">[</span>first<span class="token punctuation">,</span> second<span class="token punctuation">,</span> third<span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token number">8</span><span class="token punctuation">,</span> <span class="token number">4</span><span class="token punctuation">,</span> <span class="token number">100</span><span class="token punctuation">,</span> <span class="token operator">-</span><span class="token number">5</span><span class="token punctuation">,</span> <span class="token number">20</span><span class="token punctuation">]</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output: Doe, John</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>lName <span class="token operator">+</span> <span class="token string">\', \'</span><span class="token operator">+</span> fName<span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output: 100, 4, 8</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>third<span class="token punctuation">,</span> second<span class="token punctuation">,</span> first<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>As you can see, we can store properties of an object or elements of an array using pattern matching. You can find many more examples in the <a href="/learning-es6/#destructuring">destructuring code examples</a> which are part of the <a href="https://github.com/benmvp/learning-es6"><em>Learning ES6</em> Github repo</a>.</p>\n<p>If you’re finding destructuring intriguing (which you should), keep on reading for a more in-depth explanation.</p>\n<h2 id="some-background"><a href="#some-background" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Some background</h2>\n<p>JavaScript developers spend quite a bit of time extracting data from arrays and objects. Destructuring allows variable binding via pattern matching with support for both arrays and objects. The patterns closely resemble those of array and object literals. Destructuring is also fail-soft, meaning that values not found return <code class="language-text">undefined</code> instead of an error.</p>\n<p>But first, let’s take a look at how we deal with objects and arrays currently. There is a verbose way of defining objects and arrays:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">var</span> config <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Object</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n\tmyArray <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Array</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\nconfig<span class="token punctuation">.</span>delay <span class="token operator">=</span> <span class="token number">500</span><span class="token punctuation">;</span>\nconfig<span class="token punctuation">.</span>title <span class="token operator">=</span> <span class="token string">\'Hi!\'</span><span class="token punctuation">;</span>\nconfig<span class="token punctuation">.</span>info <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Object</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// add to nested object</span>\nconfig<span class="token punctuation">.</span>info<span class="token punctuation">.</span>name <span class="token operator">=</span> <span class="token string">\'Elijah\'</span><span class="token punctuation">;</span>\n\nmyArray<span class="token punctuation">.</span><span class="token function">push</span><span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\nmyArray<span class="token punctuation">.</span><span class="token function">push</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token class-name">Array</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\nmyArray<span class="token punctuation">.</span><span class="token function">push</span><span class="token punctuation">(</span><span class="token boolean">true</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// add to nested array</span>\nmyArray<span class="token punctuation">[</span><span class="token number">1</span><span class="token punctuation">]</span><span class="token punctuation">.</span><span class="token function">push</span><span class="token punctuation">(</span><span class="token string">\'hello\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>This can be significantly shortened into one-liners using literal syntax:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">var</span> config <span class="token operator">=</span> <span class="token punctuation">{</span>delay<span class="token punctuation">:</span> <span class="token number">500</span><span class="token punctuation">,</span> title<span class="token punctuation">:</span> <span class="token string">\'Hi!\'</span><span class="token punctuation">,</span> info<span class="token punctuation">:</span> <span class="token punctuation">{</span>name<span class="token punctuation">:</span> <span class="token string">\'Elijah\'</span><span class="token punctuation">}</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n\tmyArray <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token number">1</span><span class="token punctuation">,</span> <span class="token punctuation">[</span><span class="token string">\'hello\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token boolean">true</span><span class="token punctuation">]</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Similarly, there’s a verbose way of retrieving data from objects and arrays:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">var</span> config <span class="token operator">=</span> <span class="token punctuation">{</span>delay<span class="token punctuation">:</span> <span class="token number">500</span><span class="token punctuation">,</span> title<span class="token punctuation">:</span> <span class="token string">\'Hi!\'</span><span class="token punctuation">,</span> info<span class="token punctuation">:</span> <span class="token punctuation">{</span>name<span class="token punctuation">:</span> <span class="token string">\'Elijah\'</span><span class="token punctuation">}</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n\tKEY <span class="token operator">=</span> <span class="token string">\'info\'</span><span class="token punctuation">,</span>\n\tdelay <span class="token operator">=</span> config<span class="token punctuation">.</span>delay<span class="token punctuation">,</span>\n\tconfigTitle <span class="token operator">=</span> config<span class="token punctuation">[</span><span class="token string">\'title\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\tinfo <span class="token operator">=</span> config<span class="token punctuation">[</span>KEY<span class="token punctuation">]</span><span class="token punctuation">,</span>\n\tfullName <span class="token operator">=</span> config<span class="token punctuation">.</span>name<span class="token punctuation">,</span>\n\n\tmyArray <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token number">1</span><span class="token punctuation">,</span> <span class="token punctuation">[</span><span class="token string">\'hello\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token boolean">true</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\tfirst <span class="token operator">=</span> myArray<span class="token punctuation">[</span><span class="token number">0</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\tsecond <span class="token operator">=</span> myArray<span class="token punctuation">[</span><span class="token number">1</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\tsecondNest <span class="token operator">=</span> second<span class="token punctuation">[</span><span class="token number">0</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\tthird <span class="token operator">=</span> myArray<span class="token punctuation">[</span><span class="token number">2</span><span class="token punctuation">]</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>ES6 provides a new syntax for quickly retrieving property values from objects and elements from arrays. This process is called <em>destructuring assignment</em> and we’ll spend the rest of our time looking at examples.</p>\n<h2 id="object-destructuring"><a href="#object-destructuring" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Object destructuring</h2>\n<p>Object destructuring assignment uses an object literal pattern on the left hand side of an assignment operation. Let’s convert the object portion of the  ES5 example above using ES6 destructuring (and <code class="language-text">let</code>):</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> config <span class="token operator">=</span> <span class="token punctuation">{</span>delay<span class="token punctuation">:</span> <span class="token number">500</span><span class="token punctuation">,</span> title<span class="token punctuation">:</span> <span class="token string">\'Hi!\'</span><span class="token punctuation">,</span> info<span class="token punctuation">:</span> <span class="token punctuation">{</span>name<span class="token punctuation">:</span> <span class="token string">\'Elijah\'</span><span class="token punctuation">}</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">{</span>delay<span class="token punctuation">,</span> info<span class="token punctuation">,</span> title<span class="token punctuation">}</span> <span class="token operator">=</span> config<span class="token punctuation">;</span>\n\n<span class="token comment">// output: {name: \'Elijah\'}, 500, \'Hi!\'</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>info<span class="token punctuation">,</span> delay<span class="token punctuation">,</span> title<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>We were able to store references to the 3 property values within <code class="language-text">config</code> into variables with names that matched the property keys of <code class="language-text">config</code>. This is actually the shorthand syntax for object destructuring. If instead we wanted to use different variable names, we can use the full syntax:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> config <span class="token operator">=</span> <span class="token punctuation">{</span>\n\t\tdelay<span class="token punctuation">:</span> <span class="token number">500</span><span class="token punctuation">,</span>\n\t\ttitle<span class="token punctuation">:</span> <span class="token string">\'Hi!\'</span><span class="token punctuation">,</span>\n\t\tinfo<span class="token punctuation">:</span> <span class="token punctuation">{</span>name<span class="token punctuation">:</span> <span class="token string">\'Elijah\'</span><span class="token punctuation">}</span>\n\t<span class="token punctuation">}</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">{</span>\n\t\tinfo<span class="token punctuation">:</span> one<span class="token punctuation">,</span>\n\t\ttitle<span class="token punctuation">:</span> two<span class="token punctuation">,</span>\n\t\tempty<span class="token punctuation">:</span> three<span class="token punctuation">,</span>\n\t\tdelay<span class="token punctuation">:</span> four\n\t<span class="token punctuation">}</span> <span class="token operator">=</span> config<span class="token punctuation">;</span>\n\n<span class="token comment">// output: {name: \'Elijan\'}, \'Hi!\', undefined, 500</span>\n<span class="token comment">// missing properties have `undefined` value</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>one<span class="token punctuation">,</span> two<span class="token punctuation">,</span> three<span class="token punctuation">,</span> four<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>We were able to use an alias for the <code class="language-text">info</code> property from <code class="language-text">config</code>, naming it <code class="language-text">one</code>. We did the same for <code class="language-text">title</code> (<code class="language-text">two</code>) and <code class="language-text">delay</code> (<code class="language-text">four</code>). Notice that we also tried to get the <code class="language-text">empty</code> property out of <code class="language-text">config</code> but since it doesn’t exist <code class="language-text">three</code> is <code class="language-text">undefined</code>. This works exactly how it would in ES5 with dot- or bracket-notation.</p>\n<h3 id="nested-object-destructuring"><a href="#nested-object-destructuring" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Nested object destructuring</h3>\n<p>Destructuring also supports nesting. So if we wanted to get the value of <code class="language-text">config.info.name</code> (<code class="language-text">fullName</code> variable in the early example) we can do the following:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> config <span class="token operator">=</span> <span class="token punctuation">{</span>delay<span class="token punctuation">:</span> <span class="token number">500</span><span class="token punctuation">,</span> title<span class="token punctuation">:</span> <span class="token string">\'Hi!\'</span><span class="token punctuation">,</span> info<span class="token punctuation">:</span> <span class="token punctuation">{</span>name<span class="token punctuation">:</span> <span class="token string">\'Elijah\'</span><span class="token punctuation">}</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n\n\t<span class="token comment">// `delay` is using shorthand syntax mixed in w/</span>\n\t<span class="token comment">// full syntax</span>\n\t<span class="token punctuation">{</span>\n\t\tinfo<span class="token punctuation">:</span> <span class="token punctuation">{</span>name<span class="token punctuation">:</span> fullName<span class="token punctuation">}</span><span class="token punctuation">,</span>\n\t\tdelay<span class="token punctuation">,</span>\n\t\ttitle<span class="token punctuation">:</span> configTitle\n\t<span class="token punctuation">}</span> <span class="token operator">=</span> config<span class="token punctuation">;</span>\n\n<span class="token comment">// output: \'Elijah\', \'Hi!\', 500</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>fullName<span class="token punctuation">,</span> configTitle<span class="token punctuation">,</span> delay<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>The destructure pattern we specify in order to assign to <code class="language-text">fullName</code> is a nested object. If we were ok with the values of <code class="language-text">config.info.name</code> going into a variable named <code class="language-text">name</code>, we could’ve simply done: <code class="language-text">{info: {name}}</code>. It’s worth pointing out that you can not assign both parent <em>and</em> child properties at the same time. So in the example, you can either get the <code class="language-text">info</code> property <em>or</em> its child properties. Not both.</p>\n<p>We learned earlier that destructuring is fail-soft so missing properties result in <code class="language-text">undefined</code> values. This doesn’t apply, however, when trying to assign a missing child property whose parent property is also missing:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> options <span class="token operator">=</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n\n\t<span class="token comment">// `delay` would be `undefined`, but trying</span>\n\t<span class="token comment">// to assign to `name` is an error</span>\n\t<span class="token comment">// since `options.info` is already `undefined`</span>\n\t<span class="token punctuation">{</span>delay<span class="token punctuation">,</span> info<span class="token punctuation">:</span> <span class="token punctuation">{</span>name<span class="token punctuation">}</span><span class="token punctuation">}</span> <span class="token operator">=</span> options<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h3 id="computed-values-in-object-destructuring"><a href="#computed-values-in-object-destructuring" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Computed values in object destructuring</h3>\n<p>Destructure patterns also support using computed values in the full syntax:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">const</span> KEY <span class="token operator">=</span> <span class="token string">\'empty\'</span><span class="token punctuation">;</span>\n<span class="token keyword">let</span> options <span class="token operator">=</span> <span class="token punctuation">{</span>delay<span class="token punctuation">:</span><span class="token number">500</span><span class="token punctuation">,</span> empty<span class="token punctuation">:</span><span class="token boolean">true</span><span class="token punctuation">,</span> title<span class="token punctuation">:</span><span class="token string">\'Hi!\'</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">{</span><span class="token punctuation">[</span>KEY<span class="token punctuation">]</span><span class="token punctuation">:</span> empty<span class="token punctuation">,</span> delay<span class="token punctuation">,</span> title<span class="token punctuation">}</span> <span class="token operator">=</span> options<span class="token punctuation">;</span>\n\n<span class="token comment">// outputs: \'Hi!\', 500, true</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>title<span class="token punctuation">,</span> delay<span class="token punctuation">,</span> empty<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h3 id="object-destructuring-gotchas"><a href="#object-destructuring-gotchas" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Object destructuring gotchas</h3>\n<p>You don’t have to exclusively use destructuring when declaring a variable via <code class="language-text">let</code> or <code class="language-text">const</code> (or <code class="language-text">var</code> if you’re still in to that sort of thing). You can use it for normal assignments to variables that have already been declared.  However, when you do assignment-only object destructuring, you have to wrap the <em>entire statement</em> in parentheses:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> a<span class="token punctuation">,</span>\n\tb <span class="token operator">=</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n<span class="token comment">// some code</span>\n\n<span class="token punctuation">(</span> <span class="token punctuation">{</span>a<span class="token punctuation">,</span> b<span class="token punctuation">:</span> b<span class="token punctuation">.</span>count<span class="token punctuation">}</span> <span class="token operator">=</span> <span class="token punctuation">{</span>a<span class="token punctuation">:</span> <span class="token number">1</span><span class="token punctuation">,</span> b<span class="token punctuation">:</span> <span class="token number">2</span><span class="token punctuation">}</span> <span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output: 1, {count: 2}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>a<span class="token punctuation">,</span> b<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>If you leave off the parenthesis you will get a <code class="language-text">SyntaxError</code>. This is because without the parentheses the statement looks like an invalid code block to the JavaScript engine. You should also notice that in the assignment, we assigned directly to <code class="language-text">b.count</code>. Basically, anything that can accept an assignment can be used in a destructure pattern.</p>\n<h2 id="array-destructuring"><a href="#array-destructuring" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Array destructuring</h2>\n<p>Array destructuring works much the same way as object destructuring except you use an array literal destructure pattern for the left hand side assignment operation. As we saw earlier, the ES5 way of storing elements of an array into a variable can be pretty cumbersome. We can rewrite it in ES6 as such:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> myArray <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token number">1</span><span class="token punctuation">,</span> <span class="token punctuation">[</span><span class="token string">\'hello\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token boolean">true</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">[</span>first<span class="token punctuation">,</span> second<span class="token punctuation">,</span> third<span class="token punctuation">]</span> <span class="token operator">=</span> myArray<span class="token punctuation">;</span>\n\n<span class="token comment">// output: 1, [\'hello\'], true</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>first<span class="token punctuation">,</span> second<span class="token punctuation">,</span> third<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>There’s only one syntax with array destructuring and that’s the shorthand syntax because the index that the variable will map to is implied by its order in the array literal destructure pattern.</p>\n<h3 id="nested-array-destructuring"><a href="#nested-array-destructuring" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Nested array destructuring</h3>\n<p>If instead we wanted to get the element <em>within</em> the <code class="language-text">second</code> array, we can use a nesting pattern similar to what we did with object destructuring:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> myArray <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token number">1</span><span class="token punctuation">,</span> <span class="token punctuation">[</span><span class="token string">\'hello\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token boolean">true</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">[</span>first<span class="token punctuation">,</span> <span class="token punctuation">[</span>secondNest<span class="token punctuation">]</span><span class="token punctuation">,</span> third<span class="token punctuation">]</span> <span class="token operator">=</span> myArray<span class="token punctuation">;</span>\n\n<span class="token comment">// output: 1, \'hello\', true</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>first<span class="token punctuation">,</span> secondNest<span class="token punctuation">,</span> third<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h3 id="skipping-indices-in-array-destructuring"><a href="#skipping-indices-in-array-destructuring" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Skipping indices in array destructuring</h3>\n<p>Even though the array literal destructure pattern is order-dependent, we can still pick and choose which elements of the array we want stored as variables by skipping indices:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> sequence <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token number">0</span><span class="token punctuation">,</span> <span class="token number">1</span><span class="token punctuation">,</span> <span class="token number">1</span><span class="token punctuation">,</span> <span class="token number">2</span><span class="token punctuation">,</span> <span class="token number">3</span><span class="token punctuation">,</span> <span class="token number">5</span><span class="token punctuation">,</span> <span class="token number">8</span><span class="token punctuation">,</span> <span class="token number">13</span><span class="token punctuation">,</span> <span class="token number">21</span><span class="token punctuation">,</span> <span class="token number">34</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">[</span>first<span class="token punctuation">,</span> <span class="token punctuation">,</span> third<span class="token punctuation">,</span> fourth<span class="token punctuation">,</span> <span class="token punctuation">,</span> <span class="token punctuation">,</span> seventh<span class="token punctuation">]</span> <span class="token operator">=</span> sequence\n<span class="token punctuation">;</span>\n\n<span class="token comment">// output: 0, 1, 2, 8</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>first<span class="token punctuation">,</span> third<span class="token punctuation">,</span> fourth<span class="token punctuation">,</span> seventh<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Pretty cool, huh?</p>\n<h2 id="mixed-object--array-destructuring"><a href="#mixed-object--array-destructuring" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Mixed object &#x26; array destructuring</h2>\n<p>As you might have already guessed, we can mix object and array literal destructure patterns. This can come in very handy when we’re pulling out various pieces of data from a JSON object because we no longer have to navigate the entire structure.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> json <span class="token operator">=</span> <span class="token punctuation">{</span>\n\t\tshapes<span class="token punctuation">:</span> <span class="token punctuation">[</span><span class="token string">\'circle\'</span><span class="token punctuation">,</span> <span class="token string">\'square\'</span><span class="token punctuation">,</span> <span class="token string">\'triangle\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\t\tcolors<span class="token punctuation">:</span> <span class="token number">5</span><span class="token punctuation">,</span>\n\t\tfill<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n\t\tauthor<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n\t\t\tfirstName<span class="token punctuation">:</span> <span class="token string">\'Ben\'</span><span class="token punctuation">,</span>\n\t\t\tlastName<span class="token punctuation">:</span> <span class="token string">\'Ilegbodu\'</span><span class="token punctuation">,</span>\n\t\t\tcity<span class="token punctuation">:</span> <span class="token string">\'Pittsburg\'</span>\n\t\t<span class="token punctuation">}</span>\n\t<span class="token punctuation">}</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">{</span>\n\t\tfill<span class="token punctuation">,</span>\n\t\tauthor<span class="token punctuation">:</span> <span class="token punctuation">{</span>lastName<span class="token punctuation">,</span> firstName<span class="token punctuation">,</span> city<span class="token punctuation">}</span><span class="token punctuation">,</span>\n\t\tshapes<span class="token punctuation">:</span> <span class="token punctuation">[</span><span class="token punctuation">,</span> secondShape<span class="token punctuation">]</span><span class="token punctuation">,</span>\n\t\tcolors<span class="token punctuation">:</span> numColors\n\t<span class="token punctuation">}</span> <span class="token operator">=</span> json<span class="token punctuation">;</span>\n\n<span class="token comment">// output: true, square, 5</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>fill<span class="token punctuation">,</span> secondShape<span class="token punctuation">,</span> numColors<span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token comment">// output: Ilegbodu, Ben, Pittsburg</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>lastName<span class="token punctuation">,</span> firstName<span class="token punctuation">,</span> city<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Now that’s powerful stuff.</p>\n<h2 id="destructuring-use-cases"><a href="#destructuring-use-cases" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Destructuring use cases</h2>\n<p>The mixed object and array destructuring with JSON data is a real-world use case. Here are a few more.</p>\n<h3 id="swapping-values"><a href="#swapping-values" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Swapping values</h3>\n<p>What happens if we need to swap values in two variables? In the standard answer, we end up needing a third <code class="language-text">temp</code> variable:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">var</span> a <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">,</span>\n\tb <span class="token operator">=</span> <span class="token number">2</span><span class="token punctuation">,</span>\n\ttemp<span class="token punctuation">;</span>\n\ntemp <span class="token operator">=</span> a<span class="token punctuation">;</span>\na <span class="token operator">=</span> b<span class="token punctuation">;</span>\nb <span class="token operator">=</span> temp<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>However, now that we have destructuring, we can use array destructuring to quickly swap two numbers without the need for a <code class="language-text">temp</code> variable:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> a <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">,</span>\n\tb <span class="token operator">=</span> <span class="token number">2</span><span class="token punctuation">;</span>\n\n<span class="token punctuation">[</span>b<span class="token punctuation">,</span> a<span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token punctuation">[</span>a<span class="token punctuation">,</span> b<span class="token punctuation">]</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>See what we did there? We constructed an array using the array literal syntax with two elements: <code class="language-text">a</code> and <code class="language-text">b</code>. Then using array destructuring we assigned the first element of the newly created array into <code class="language-text">b</code> and the second element into <code class="language-text">a</code>. The result is that the variables’ values have swapped. Now technically we did still create a temporary array, but we never had to store it into a variable.</p>\n<h3 id="destructuring-class-objects"><a href="#destructuring-class-objects" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Destructuring class objects</h3>\n<p>Class objects are similar to object literals except they are created using <code class="language-text">prototype</code>. As long as properties of the class object are accessible via dot- or bracket-notation, they will also be available via object destructuring. Here’s an example using the <code class="language-text">Location</code> object:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> <span class="token punctuation">{</span>\n\t\tprotocol<span class="token punctuation">:</span> scheme<span class="token punctuation">,</span>\n\t\thost<span class="token punctuation">:</span> domain<span class="token punctuation">,</span>\n\t\tpathname<span class="token punctuation">:</span> path<span class="token punctuation">,</span>\n\t\tsearch<span class="token punctuation">:</span> query<span class="token punctuation">,</span>\n\t\thash<span class="token punctuation">,</span>\n\t\thref<span class="token punctuation">:</span> url\n\t<span class="token punctuation">}</span> <span class="token operator">=</span> location<span class="token punctuation">;</span>\n\n<span class="token comment">// output: true</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>\n\t<span class="token punctuation">(</span>scheme <span class="token operator">+</span> <span class="token string">\'//\'</span> <span class="token operator">+</span> domain <span class="token operator">+</span> path <span class="token operator">+</span> query <span class="token operator">+</span> hash<span class="token punctuation">)</span> <span class="token operator">==</span> url\n<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h3 id="destructuring-return-values"><a href="#destructuring-return-values" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Destructuring return values</h3>\n<p>Many methods on JavaScript APIs return arrays (such as <code class="language-text">exec</code> on <code class="language-text">RegExp</code> objects or <code class="language-text">split</code> on <code class="language-text">String</code> objects). You can use array destructuring to get the array values into variables quickly:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> <span class="token punctuation">[</span><span class="token punctuation">,</span> areaCode<span class="token punctuation">,</span> exchange<span class="token punctuation">,</span> lineNumber<span class="token punctuation">]</span> <span class="token operator">=</span>\n\t<span class="token regex">/^(\\d\\d\\d)-(\\d\\d\\d)-(\\d\\d\\d\\d)$/</span>\n\t\t<span class="token punctuation">.</span><span class="token function">exec</span><span class="token punctuation">(</span><span class="token string">\'650-555-1234\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output: 650, 555, 1234</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>areaCode<span class="token punctuation">,</span> exchange<span class="token punctuation">,</span> lineNumber<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>As we know, <code class="language-text">exec</code> returns an array of the matching groups with the first element being the entire match. We’re not interested in that first piece, so we skip it and get the remaining three parts. You can imagine what this code looks like in ES5.</p>\n<h3 id="handling-multiple-return-values"><a href="#handling-multiple-return-values" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Handling multiple return values</h3>\n<p>Sometimes a function needs to return multiple pieces of data. This typically packaged together in an object literal or as an array tuple. Once again we can use destructuring to easily get out the data we care about.</p>\n<p>Let’s say we have a <code class="language-text">find</code> method that takes as parameters an array <code class="language-text">list</code> and a string <code class="language-text">token</code>, where it finds the first string in  <code class="language-text">list</code> that contains <code class="language-text">token</code>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">function</span> <span class="token function">find</span><span class="token punctuation">(</span>list<span class="token punctuation">,</span> token<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n\t<span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> i <span class="token operator">=</span> <span class="token number">0</span><span class="token punctuation">;</span> i <span class="token operator">&lt;</span> list<span class="token punctuation">.</span>length<span class="token punctuation">;</span> i<span class="token operator">++</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n\t\t<span class="token keyword">if</span> <span class="token punctuation">(</span>list<span class="token punctuation">[</span>i<span class="token punctuation">]</span><span class="token punctuation">.</span><span class="token function">indexOf</span><span class="token punctuation">(</span>token<span class="token punctuation">)</span> <span class="token operator">></span> <span class="token operator">-</span><span class="token number">1</span><span class="token punctuation">)</span>\n\t\t\t<span class="token keyword">return</span> <span class="token punctuation">{</span>index<span class="token punctuation">:</span> i<span class="token punctuation">,</span> val<span class="token punctuation">:</span> list<span class="token punctuation">[</span>i<span class="token punctuation">]</span><span class="token punctuation">}</span><span class="token punctuation">;</span>\n\t<span class="token punctuation">}</span>\n\n\t<span class="token comment">// match not found</span>\n\t<span class="token keyword">return</span> <span class="token punctuation">{</span>index<span class="token punctuation">:</span> <span class="token operator">-</span><span class="token number">1</span><span class="token punctuation">,</span> val<span class="token punctuation">:</span> undefined<span class="token punctuation">}</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>Now a caller of <code class="language-text">find</code> might care about the index at which <code class="language-text">token</code> was found or it might care about the string itself. That’s why <code class="language-text">find</code> returns an object literal containing both the <code class="language-text">index</code> number and the <code class="language-text">val</code> string.</p>\n<p>If the caller needs a reference to both pieces of information, they can do:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> fruits <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token string">\'apple\'</span><span class="token punctuation">,</span> <span class="token string">\'grape\'</span><span class="token punctuation">,</span> <span class="token string">\'peach\'</span><span class="token punctuation">,</span> <span class="token string">\'pear\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">{</span>index<span class="token punctuation">,</span> val<span class="token punctuation">}</span> <span class="token operator">=</span> <span class="token function">find</span><span class="token punctuation">(</span>fruits<span class="token punctuation">,</span> <span class="token string">\'ape\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Or if they just care about the <code class="language-text">val</code>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> fruits <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token string">\'apple\'</span><span class="token punctuation">,</span> <span class="token string">\'grape\'</span><span class="token punctuation">,</span> <span class="token string">\'peach\'</span><span class="token punctuation">,</span> <span class="token string">\'pear\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">{</span>val<span class="token punctuation">}</span> <span class="token operator">=</span> <span class="token function">find</span><span class="token punctuation">(</span>fruits<span class="token punctuation">,</span> <span class="token string">\'ape\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Or if they care just about the <code class="language-text">index</code>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> fruits <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token string">\'apple\'</span><span class="token punctuation">,</span> <span class="token string">\'grape\'</span><span class="token punctuation">,</span> <span class="token string">\'peach\'</span><span class="token punctuation">,</span> <span class="token string">\'pear\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n\t<span class="token punctuation">{</span>index<span class="token punctuation">}</span> <span class="token operator">=</span> <span class="token function">find</span><span class="token punctuation">(</span>fruits<span class="token punctuation">,</span> <span class="token string">\'ape\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h2 id="combining-destructuring--es6-other-operators"><a href="#combining-destructuring--es6-other-operators" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Combining destructuring &#x26; ES6 other operators</h2>\n<p>We can actually combine destructure patterns with other ES6 operators such as the spread and rest operators. We can also use default values with them. We can even use them to destructure function arguments directly in the arguments definition. However, we haven’t talked about any of these concepts yet, so we’ll save them for our next discussion on parameter handling.</p>\n<h2 id="javascript-engine-support"><a href="#javascript-engine-support" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>JavaScript engine support</h2>\n<p>According to the <a href="http://kangax.github.io/compat-table/es6/">ECMAScript 6 Compatibility table</a>, the following JavaScript engines support destructuring:</p>\n<ul>\n<li>Babel</li>\n<li>Traceur</li>\n<li>TypeScript</li>\n<li>Firefox (does support default values in destructure patterns yet)</li>\n<li>Safari (partial support)</li>\n</ul>\n<p>It’s surprising to see that Chrome doesn’t yet support destructuring. Neither does node.js or io.js. This is also the first feature we’ve covered that Microsoft’s Edge doesn’t support either. My guess is that this feature may be low priority for these vendors since it’s basically 100% syntactic sugar. At least <a href="/learning-es6-arrow-functions/">arrow functions</a> providing proper <code class="language-text">this</code> binding and <a href="/learning-es6-block-level-scoping-let-const/">block-scoping</a> fixed variable hoisting.</p>\n<h2 id="additional-resources"><a href="#additional-resources" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Additional resources</h2>\n<p>You can check out the <a href="/learning-es6/#destructuring"><em>Learning ES6</em> examples page</a> for the <a href="https://github.com/benmvp/learning-es6"><em>Learning ES6</em> Github repo</a> where you will find all of the code used in this article running natively in the browser (for those that support destructuring). There are also examples running through Babel and Traceur transpilation.</p>\n<p>Other super helpful resources:</p>\n<ul>\n<li><a href="http://exploringjs.com/es6/ch_destructuring.html">Destructuring</a> in <a href="http://exploringjs.com/es6/"><em>Exploring ES6</em></a> by <a href="https://twitter.com/rauschma">Axel Rauschmayer</a></li>\n<li><a href="https://leanpub.com/understandinges6/read#leanpub-auto-destructuring-assignment">Destructuring Assignment</a> in <a href="https://leanpub.com/understandinges6/"><em>Understanding ECMAScript 6</em></a> by <a href="https://twitter.com/slicknet">Nicholas C. Zakas</a></li>\n<li><a href="http://ponyfoo.com/articles/es6-destructuring-in-depth">Destructuring in Depth</a> in <a href="http://ponyfoo.com/articles/tagged/es6-in-depth"><em>ES6 in Depth</em></a> by <a href="https://twitter.com/nzgb">Nicolas Bevacqua</a></li>\n</ul>\n<h2 id="coming-up-next"><a href="#coming-up-next" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Coming up next…</h2>\n<p>As promised, the <a href="/learning-es6-series/"><em>Learning ES6</em> series</a> continues with a deep look at all the new ECMAScript 6 features for <a href="/learning-es6-parameter-handling/">parameter handling</a>. Until then…</p>',
fields:{slug:"/learning-es6-destructuring/",prefix:"2015-09-02"},frontmatter:{title:"Destructuring",subTitle:"The Learning ES6 Series",cover:{childImageSharp:{resize:{src:"/static/pass-baton-d303c904829efa076ed9f6844d8b9d75-ada8c.jpg"}}}}},author:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:'<p>Ben is a Christian, husband and father of 2 girls, with a dozen years of experience developing user interfaces for the Web. He currently is a Principal Frontend Engineer at Eventbrite on the Frontend Platform team, focused on improving their React-based design system and frontend infrastructure. Ben also enjoys playing basketball, DIY, watching movies, and <a href="https://twitter.com/benmvp">tweeting</a> / <a href="http://www.benmvp.com">blogging</a> about his experiences with new web technologies.</p>'},footnote:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>© Ben Ilegbodu 2018.</li>\n<li>Powered by <a href="https://www.gatsbyjs.org/">Gatsby</a> &#x26; <a href="https://reactjs.org">React</a> using <a href="https://github.com/greglobinski/gatsby-starter-personal-blog">gatsby-starter-personal-blog</a>.</li>\n</ul>'}},pathContext:{slug:"/learning-es6-destructuring/"}}}});
//# sourceMappingURL=path---learning-es-6-destructuring-7151698cd5e8a4976323.js.map